window.bookSummaryJSON = "<p><b>Lovers-Enemies-Lovers Forced Marriage Mafia Romance </b></p> <p><b>Basilio DiLustro. </b><br> <b>Charming. Deadly. A monster dressed in a three-piece-suit.</b><br> <br> <b>Wynter Star. </b><br> <b>Realist with the most romantic of hearts, hiding it all under her ice princess fame.</b><br> <br> The two were never meant to cross paths. When they do, worlds collide and volcanoes erupt.<br> Basilio makes her feel everything when she’s with him. Protected. Loved. Desired.<br> <br> Every monster has a weakness. She’s his. His obsession. His addiction. His only salvation.<br> Theirs is a love twisted with secrets and tainted by lies. And when history comes knocking, it could shatter everything.</p>"; 
